import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { CssBaseline } from '@material-ui/core';
import "./Landing.css"
// import AppBar from '@material-ui/core/AppBar';
// import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
// import Button from '@material-ui/core/Button';
// import IconButton from '@material-ui/core/IconButton';
// import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: '100vh',
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    display: "flex",
    justifyContent: "center",
  },

title: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "10vh"


  }


}));

function Landing() {
  const classes = useStyles();
  return (
    <div >
        <CssBaseline />
        <video  zIndex="modal" className={classes.root} id="hero-video" src="/assets/hero.mp4" autoPlay loop muted/> 

    <div className={classes.title}>

    <Typography
      component="div"
      variant="body1"
      style={{ height: 100, width: '100%', position: 'relative' }}
    >John Rrukaj</Typography>

    </div>

        <div className="Banner-text">
            <h1 className="title" zIndex="tooltip" >Solutions Architect and SysOps Administrator</h1>
            <hr/>
            <p>AWS | HTML/CSS | JAVASCRIPT | NODE.JS | REACT </p>

            {/* Linkedin  */}

            <div className="Social-media-links">
            <a href="http://google.com" rel="noopener noreferrer" target="_blank">
            <i class="fab fa-linkedin"></i> 
            </a>

            {/* Github */}
            <a href="http://google.com" rel="noopener noreferrer" target="_blank">
                <i class="fab fa-github-square"></i>
            </a>

           {/* Website */}
             <a href="http://google.com" rel="noopener noreferrer" target="_blank">
                <i class="fas fa-portrait" aria-hidden="true"></i>
            </a>

            </div>

            </div>

            </div>
  )
}

export default Landing
